Zodiac is a 2007 Mystery/Thriller film directed by David Fincher and based on Robert Graysmith's non-fiction book of the same name. The Paramount Pictures and Warner Bros. Pictures joint production stars Jake Gyllenhaal, Mark Ruffalo, and Robert Downey, Jr..

Zodiac tells the story of the hunt for a notorious serial killer known as &quot;Zodiac&quot; who killed in and around the San Francisco Bay Area during the late 1960s and early 1970s, leaving several victims in his wake and taunting police with letters and ciphers mailed to newspapers. The case remains one of San Francisco's most infamous unsolved crimes.


